import React, { useDebugValue } from "react";
import {CrecheUserx} from '../../../data';

import CrecheCard from "./CrecheCard";

 const CrecheSlider = () => { 

  const datacamp = CrecheUserx.map((data) => {
   
    return (
      <div>
      if (data.name===CrecheUserx[0].name) {
        <CrecheCard key={data.key}  name={CrecheUserx[0].name} Location={data.Location} Description={data.Description}  />
      }
      </div>
     
    )
  }) 

  
      return ( 
      <div className="w-full grid xs:grid-cols-2 ">
             {datacamp}
      </div>
            

          );
        };

 export default CrecheSlider;
